import * as React from "react";

import futureBrightLogo from './FutureBrightLogo.svg';
import settingsImg from './gear-icon.png';
import notificationsImg from './bell-icon.png';
import profileImg from './profile-icon.jpeg';

import "./Header.css";

const Header = () => {
  return (
    <div className="top-menu padding8 flexed justify-start">
  		<h1 className="brand margin0 inline-blocked">FutureBright</h1>
  		<div className="search-wrapper">
  			<input type="text" className="search-input" placeholder="search..."></input>
  		</div>
  		<nav className="inline-blocked">
  			<a href="" className="menu-item padding8">
  				Home
  			</a>
  			<a href="" class="menu-item padding8">
  				Products
  			</a>
  			<a href="" class="menu-item padding8">
  				Contact
  			</a>
  			<a href="" className="menu-item padding8">
  				About
  			</a>
  		</nav>
  	</div>
  );
}

export default Header;
